From the problem, we have the following system of equations:
1. \( k + v = 1.24 \)
2. \( 5k + v = 1.82 \)

To eliminate \( v \), we subtract the first equation from the second equation:
\[ (5k + v) - (k + v) = 1.82 - 1.24 \]
\[ 5k + v - k - v = 0.58 \]
\[ 4k = 0.58 \]

Next, we solve for \( k \) by dividing both sides of the equation by 4:
\[ k = \frac{0.58}{4} \]
\[ k = 0.145 \]

