Suorakulmion $ABCD$ keskipiste on $O$ ja $AB/AD=k$. Piste valitaan satunnaisesti suorakulmion $ABCD$ sisäpuolelta. Mikä on todennäköisyys, että se on lähempänä pistettä $O$ kuin mitään neljästä kärjestä?  [asy]
size(200);
draw((-250,100)--(250,100)--(250,-100)--(-250,-100)--cycle);
dot((0,0));
label("$O$",(0,0),N);
label("$A$",(-250,100),NW); label("$B$",(250,100),NE); label("$C$",(250,-100),SE); label("$D$",(-250,-100),SW);[/asy]

